import './Machinebox.css'
import  foto1 from "./img/foto_1.png"
import  foto2 from "./img/foto_2.png" 
import  foto3 from "./img/foto_3.png" 



// const Machinebox = () => {
export default function Machinebox(props) {
    var ruta_variable = ""
    if (props === "A")
    {
        ruta_variable = foto1
    }

    var ruta = "foto_1.png"
    let ruta2 = foto3

    return (

        <div className="Machinebox_div">
            <div className="tooltip">Hover over me
                {/* <span class="tooltiptext"></span> */}
                <figure className="tooltiptext">
                    <img  alt="imagen" src={require(`../img/maquinas/${ruta}`)}></img>
                    <img  alt="imagen" src={ruta2}></img>

                    <p>{ruta_variable}</p>
                </figure>
            </div>
        </div>
    )

}




